import React, { Component } from "react";

export class Footer extends Component {
	render() {
		return (
			<div>
				<footer class="mastfoot mt-auto">          
					<div class="inner">
						<p>Data and Cloud Computing Society, 2020 ©</p>          
					</div>
					          
				</footer>
			</div>
		);
	}
}

export default Footer;
